import React from 'react'
import { useAuthStore } from '../store/auth.js'

const Navbar = () => {
    const { user } = useAuthStore()
    return (
        <>
          <p>{user.email}</p>

            <div>Navbar</div>
        </>
    )
}

export default Navbar
